import { AiOutlineDelete } from "react-icons/ai";
import {
  ContainerContact,
  TitileContact,
  ListContatct,
  ItemContatct,
  NameContatct,
  NumberContatct,
  Wrapper,
} from "./Contacts.styled";
import { useSelector, removeContact } from "react-redux";
const Contacts = () => {
  const contacts = useSelector((state) => state.contactsSlice);
  console.log(contacts);
  return (
    <ContainerContact>
      <TitileContact>Results:</TitileContact>
      <ListContatct>
        {contacts?.map(({ id, name, phone }) => {
          console.log(id);
          return (
            <ItemContatct key={id}>
              <Wrapper>
                <NameContatct>{name}:</NameContatct>
                <NumberContatct>{phone}</NumberContatct>
              </Wrapper>

              {/* <button type="button" onClick={() => removeContact(id)}>
                <AiOutlineDelete />
              </button> */}
            </ItemContatct>
          );
        })}
      </ListContatct>
    </ContainerContact>
  );
};
export default Contacts;
